import React from 'react';
import { Container, Row, Col, Dropdown } from 'react-bootstrap';
import { MdSettings, GoSearch } from 'react-icons/all';

const UserTable = () => {

  return (
    <Container>
      <Row>
        <Col>
          <span>Flexsys</span>
          <span><MdSettings /></span>
        </Col>
      </Row>
      <Row>
        <Col>
          <div>
            <span><GoSearch/></span>
            <input type="text" placeholder="이름,조직,역할을 검색해보세요." />
          </div>
        </Col>
        <Col>

        </Col>
      </Row>
    </Container>
  );
}

export default UserTable;
